import React from 'react';
import SectionTitle from '../section_title/section_title';
import './about.css'

const aboutBlurbs = ['Hello there!',
'I\'m Justin Santos — a graduate student, programmer, and lover of technology. ' +
'Academically, my interests include data and algorithm visualization, artificial intelligence, and machine learning.' +
'When I\'m not bogged down by homework or projects, you can find me playing my favorite video games.']

class About extends React.Component {
  render() {
    let aboutTextElems = []
    for (const blurb in aboutBlurbs) {
      aboutTextElems.push(<div className="about-text"> {blurb} </div>)
    }

    return (
      <div className='about section-wrapper' id='about'>
        <SectionTitle sectionName='about' />
        <div className="about-text-wrapper"> {aboutTextElems} </div>
      </div>
    )
  }
}

export default About
